첫날엔 그럭저럭 전담 대신 할만 하더니 2일쯤 지나니까 흡입때마다 액상맛이 목구멍으로 넘어와서 토할거 같아요
그래서 덜하게 되요
좋은걸까요 아닌걸까요..ㅡㅡ;;

솔직히 다른건 아니고;;
9000이라고 적긴했는데.. 그건 아닌 것 같네요;;
연초 끊고 전담으로 바꾸면서 이걸로 시작했는데..
더 돈이 드는 것 같네요..
그냥 전담 액상 사서 하는게 더 돈이 덜 들것 같네요..
3일 정도 피우니까 간당 간당하는게 말입니까..?

